function createDevice(deviceType, id){
    kind = detemineKind(id);

    device = {
        id: id,
        name: kind.name,
        type: deviceType,
        image: kind.image,
        sokVersion: 0.1,
        description: kind.name + ' is een geweldige ' + deviceType + ' die bijvoorbeeld het commando ' + kind.commands.status.name + ' kan uitvoeren!',
        commands: kind.commands
    }

    return device;
}

